import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route} from "react-router-dom";
import Home from '../Components/home';
import Login from '../Components/login';
import ProductDetail from '../Components/product/ProductDetail';
import ProductPage from '../Components/product/productPage';
class App extends React.Component {
  constructor(props){  
    super(props);  
    this.state = {  
      isUserAthanticated: true,
      clicks: 0,
      show: 1
    }
  }
  render(){
    return (
      <Router>
        <Routes>
          <Route exact path="/" element={<Home isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          <Route exact path="/shop" element={<Home isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          <Route exact path="/products" element={<ProductPage isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          <Route exact path="/products/:productId" element={<ProductDetail isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          <Route exact path="/pages" element={<Home isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          <Route exact path="/blog" element={<Home isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          <Route exact path="/elements" element={<Home isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          <Route path="/login" element={ <Login isUserAthanticated={this.state.isUserAthanticated} clicks={this.state.clicks} show={this.state.show}/>}/>
          {/* <Navigate to="/" element={<Home />} /> */}
        </Routes>
      </Router>
    );
  }
}

export default App;
